import React from 'react'
import {NavFlex, NavItem} from './style'


const NavBar = () => {
    return (
        <NavFlex>
            <NavItem>Ana sayfa</NavItem>
            <NavItem>hakkımızda</NavItem>
            <NavItem>contact</NavItem>
        </NavFlex>
    )
}

export default NavBar
